import React from "react";
import "./Home.css";

function Home() {
  return (
    <div className="home">
      <div className="homeContainer">
        <img
          className="home_image"
          src="https://www.ikea.com/images/f9/c9/f9c9ba5d79e31c006c58a0793023c8de.png?f=xxxl"
        />
      </div>
      <p>Welcome Home</p>
    </div>
  );
}

export default Home;
